import React from 'react';

const MenuButtons = () => {
    return (
        <div className="topcorner">
            <div className="buttons">
                <div className="action_btn">
                    <button
                        name="submit"
                        className="frosted-glass jumbotron test"
                        // className="fabbtn"
                        type="submit"
                        value="Save"
                        onclick="myFunction()"
                    >
                        Help
                    </button>
                    <button
                        name="submit"
                        className="frosted-glass"
                        type="submit"
                        value="Cancel"
                        onClick="location.href='http://www.example.com'"
                    >
                        Github
                    </button>

                    <p id="saved" />
                </div>
            </div>
        </div>
    );
};

export default MenuButtons;

